/* eslint-env es6, chai*/
/* global chai, resemble */

const expect = chai.expect;

const peopleSrc =
    "data:image/jpeg;base64,";
const people2Src =
    "data:image/jpeg;base64,";

function requestSuccess() {
    return new Promise((resolve) => {
        resemble("../demoassets/People.jpg")
            .compareTo("../demoassets/People2.jpg")
            .onComplete((data) => {
                console.info("Reached oncomplete for requestSuccess");
                expect(data.diffBounds).to.have.all.keys("bottom", "left", "top", "right");
                expect(data.diffBounds.bottom).to.equal(431);
                expect(data.diffBounds.left).to.equal(22);
                expect(data.diffBounds.right).to.equal(450);
                expect(data.diffBounds.top).to.equal(58);
                expect(data.dimensionDifference.height).to.equal(0);
                expect(data.dimensionDifference.width).to.equal(0);
                expect(data.isSameDimensions).to.be.true;
                expect(data.misMatchPercentage).to.include("8.6");
                resolve();
            });
    });
}

function base64String() {
    return new Promise((resolve) => {
        resemble(peopleSrc)
            .compareTo(people2Src)
            .onComplete((data) => {
                console.info("Reached oncomplete for base64String");
                expect(data.diffBounds.bottom).to.equal(431);
                expect(data.diffBounds.left).to.equal(22);
                expect(data.diffBounds.right).to.equal(450);
                expect(data.diffBounds.top).to.equal(58);
                expect(data.dimensionDifference.height).to.equal(0);
                expect(data.dimensionDifference.width).to.equal(0);
                expect(data.isSameDimensions).to.be.true;
                expect(data.misMatchPercentage).to.include("8.6");
                resolve();
            });
    });
}

function request404() {
    return new Promise((resolve) => {
        resemble("../demoassets/People.jpg")
            .compareTo("../demoassets/404-image.jpg")
            .onComplete((data) => {
                console.info("Reached oncomplete for request404");
                expect(data).to.deep.equal({ error: "[object Event]" });
                resolve();
            });
    });
}

